font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 28px;
color: #2A2A2A;
padding-top:30px;
`;


const Quote = ({ quote }) => {
    return (
        <>
            <QuoteText>{quote}</QuoteText>


        </>
    );
}

export default Quote;
